export interface MenuItemType {
  label: string;
  path: string;
  dropdownItems: Array<{
    label?: string;
    path?: string;
  }>;
}

export interface FooterColTypeLink {
  name: string;
  title: string;
  links: Array<{
    label: string;
    path: string;
    target: string;
  }>;
}

export interface FooterColTypeContact {
  name: string;
  title: string;
  contact: string;
  social_handles: Array<{
    name: string;
    url: string;
  }>;
  office_schedule: Array<{
    day: string;
    time: string;
  }>;
}

